import "./IncExpView.css";

const IncExpView = ({ inc, exp }) => {
  return (
    <div>
      <div className="bal-container">
        <h2>Balance</h2> <br />
        <h2 className="bal">£</h2>
      </div>
      <div className="inc-exp">
        <div className="inc-container">
          <h2>Income</h2>
          <br />

          <h2 className="inc">
            £
            {inc.reduce(
              (totalinc, total) => (totalinc = totalinc + Number(total.amount)),
              0
            )}
          </h2>
        </div>

        <div className="exp-container">
          <h2>Expenses</h2>
          <br />

          <h2 className="exp">
            £
            {exp.reduce(
              (totalexp, tot) => (totalexp = totalexp + Number(tot.amount)),
              0
            )}
          </h2>
        </div>
      </div>
    </div>
  );
};
export default IncExpView;
